//{{{  lozBoard class

//{{{  lozBoard

function lozBoard () {

  this.lozza        = null;
  this.verbose      = false;
  this.mvFmt        = 0;
  this.hashUsed     = 0;

  this.b = new Uint16Array(144);    // pieces.
  this.z = new Uint16Array(144);    // indexes to w|bList.

  this.wList = new Uint16Array(16); // list of squares with white pieces.
  this.bList = new Uint16Array(16); // list of squares with black pieces.

  this.cxList = [this.wList, this.bList];

  this.firstBP = 0;
  this.firstWP = 0;

  //this.runningEvalS = 0;  // these are all cached across make/unmakeMove.
  //this.runningEvalE = 0;
  this.rights       = 0;
  this.ep           = 0;
  this.repLo        = 0;
  this.repHi        = 0;
  this.loHash       = 0;
  this.hiHash       = 0;
  //this.ploHash      = 0;
  //this.phiHash      = 0;
  this.net_h1_a     = new Float32Array(net_h1_size);

  // use separate typed arrays to save space.  optimiser probably has a go anyway but better
  // to be explicit at the expense of some conversion.  total width is 16 bytes.

  this.ttLo      = new Int32Array(TTSIZE);
  this.ttHi      = new Int32Array(TTSIZE);
  this.ttType    = new Uint8Array(TTSIZE);
  this.ttDepth   = new Int8Array(TTSIZE);   // allow -ve depths but currently not used for q.
  this.ttMove    = new Uint32Array(TTSIZE); // see constants for structure.
  this.ttEval    = new Int16Array(TTSIZE);
  this.ttScore   = new Int16Array(TTSIZE);

  //this.pttLo     = new Int32Array(PTTSIZE);
  //this.pttHi     = new Int32Array(PTTSIZE);
  //this.pttFlags  = new Uint8Array(PTTSIZE);
  //this.pttScoreS = new Int16Array(PTTSIZE);
  //this.pttScoreE = new Int16Array(PTTSIZE);
  //this.pttwLeast = new Uint32Array(PTTSIZE);
  //this.pttbLeast = new Uint32Array(PTTSIZE);
  //this.pttwMost  = new Uint32Array(PTTSIZE);
  //this.pttbMost  = new Uint32Array(PTTSIZE);

  //this.ttType.fill(TT_EMPTY);
  //this.pttFlags.fill(TT_EMPTY);

  this.turn = 0;

  //{{{  Zobrist turn
  
  this.loTurn = this.rand32();
  this.hiTurn = this.rand32();
  
  //}}}
  //{{{  Zobrist pieces
  
  this.loPieces = Array(2);
  for (var i=0; i < 2; i++) {
    this.loPieces[i] = Array(6);
    for (var j=0; j < 6; j++) {
      this.loPieces[i][j] = new Array(144);
      for (var k=0; k < 144; k++)
        this.loPieces[i][j][k] = this.rand32();
    }
  }
  
  this.hiPieces = Array(2);
  for (var i=0; i < 2; i++) {
    this.hiPieces[i] = Array(6);
    for (var j=0; j < 6; j++) {
      this.hiPieces[i][j] = new Array(144);
      for (var k=0; k < 144; k++)
        this.hiPieces[i][j][k] = this.rand32();
    }
  }
  
  //}}}
  //{{{  Zobrist rights
  
  this.loRights = new Array(16);
  this.hiRights = new Array(16);
  
  for (var i=0; i < 16; i++) {
    this.loRights[i] = this.rand32();
    this.hiRights[i] = this.rand32();
  }
  
  //}}}
  //{{{  Zobrist EP
  
  this.loEP = new Array(144);
  this.hiEP = new Array(144);
  
  for (var i=0; i < 144; i++) {
    this.loEP[i] = this.rand32();
    this.hiEP[i] = this.rand32();
  }
  
  //}}}

  this.repLoHash = new Array(1000);
  for (var i=0; i < 1000; i++)
    this.repLoHash[i] = 0;

  this.repHiHash = new Array(1000);
  for (var i=0; i < 1000; i++)
    this.repHiHash[i] = 0;

  this.phase = TPHASE;

  this.wCounts = new Uint16Array(7);
  this.bCounts = new Uint16Array(7);

  this.wCount  = 0;
  this.bCount  = 0;

  this.wHistory = Array(7)
  for (var i=0; i < 7; i++) {
    this.wHistory[i] = Array(144);
    for (var j=0; j < 144; j++)
      this.wHistory[i][j] = 0;
  }

  this.bHistory = Array(7)
  for (var i=0; i < 7; i++) {
    this.bHistory[i] = Array(144);
    for (var j=0; j < 144; j++)
      this.bHistory[i][j] = 0;
  }
}

//}}}
//{{{  .init

lozBoard.prototype.init = function () {

  for (var i=0; i < this.b.length; i++)
    this.b[i] = EDGE;

  for (var i=0; i < B88.length; i++)
    this.b[B88[i]] = NULL;

  for (var i=0; i < this.z.length; i++)
    this.z[i] = NO_Z;

  this.loHash = 0;
  this.hiHash = 0;

  //this.ploHash = 0;
  //this.phiHash = 0;

  this.repLo = 0;
  this.repHi = 0;

  this.phase = TPHASE;

  for (var i=0; i < this.wCounts.length; i++)
    this.wCounts[i] = 0;

  for (var i=0; i < this.bCounts.length; i++)
    this.bCounts[i] = 0;

  this.wCount = 0;
  this.bCount = 0;

  for (var i=0; i < this.wList.length; i++)
    this.wList[i] = EMPTY;

  for (var i=0; i < this.bList.length; i++)
    this.bList[i] = EMPTY;

  this.firstBP = 0;
  this.firstWP = 0;

  if (lozzaHost == HOST_WEB)
    this.mvFmt = SAN_FMT;
  else
    this.mvFmt = UCI_FMT;
}

//}}}
//{{{  .position

lozBoard.prototype.position = function () {

  var spec = lozza.uci.spec;

  //{{{  board turn
  
  if (spec.turn == 'w')
    this.turn = WHITE;
  
  else {
    this.turn = BLACK;
    this.loHash ^= this.loTurn;
    this.hiHash ^= this.hiTurn;
  }
  
  //}}}
  //{{{  board rights
  
  this.rights = 0;
  
  for (var i=0; i < spec.rights.length; i++) {
  
    var ch = spec.rights.charAt(i);
  
    if (ch == 'K') this.rights |= WHITE_RIGHTS_KING;
    if (ch == 'Q') this.rights |= WHITE_RIGHTS_QUEEN;
    if (ch == 'k') this.rights |= BLACK_RIGHTS_KING;
    if (ch == 'q') this.rights |= BLACK_RIGHTS_QUEEN;
  }
  
  this.loHash ^= this.loRights[this.rights];
  this.hiHash ^= this.hiRights[this.rights];
  
  //}}}
  //{{{  board board
  
  this.netReset();
  
  this.phase = TPHASE;
  
  var sq = 0;
  var nw = 0;
  var nb = 0;
  
  for (var j=0; j < spec.board.length; j++) {
  
    var ch  = spec.board.charAt(j);
    var chn = parseInt(ch);
  
    while (this.b[sq] == EDGE)
      sq++;
  
    if (isNaN(chn)) {
  
      if (ch != '/') {
  
        var obj   = MAP[ch];
        var piece = obj & PIECE_MASK;
        var col   = obj & COLOR_MASK;
  
        if (col == WHITE) {
          this.wList[nw] = sq;
          this.b[sq]     = obj;
          this.z[sq]     = nw;
          nw++;
          this.wCounts[piece]++;
          this.wCount++;
          this.netAdd(obj,sq);
        }
  
        else {
          this.bList[nb] = sq;
          this.b[sq]     = obj;
          this.z[sq]     = nb;
          nb++;
          this.bCounts[piece]++;
          this.bCount++;
          this.netAdd(obj,sq);
        }
  
        this.loHash ^= this.loPieces[col>>>3][piece-1][sq];
        this.hiHash ^= this.hiPieces[col>>>3][piece-1][sq];
  
        //if (piece == PAWN) {
          //this.ploHash ^= this.loPieces[col>>>3][0][sq];
          //this.phiHash ^= this.hiPieces[col>>>3][0][sq];
        //}
  
        this.phase -= VPHASE[piece];
  
        sq++;
      }
    }
  
    else {
  
      for (var k=0; k < chn; k++) {
        this.b[sq] = NULL;
        sq++;
      }
    }
  }
  
  //}}}
  //{{{  board ep
  
  if (spec.ep.length == 2)
    this.ep = COORDS.indexOf(spec.ep)
  else
    this.ep = 0;
  
  this.loHash ^= this.loEP[this.ep];
  this.hiHash ^= this.hiEP[this.ep];
  
  //}}}
/*
  //{{{  init running evals
  
  //this.runningEvalS = 0;
  //this.runningEvalE = 0;
  
  var next  = 0;
  var count = 0;
  
  while (count < this.wCount) {
  
    sq = this.wList[next];
  
    if (!sq) {
      next++;
      continue;
    }
  
    var piece = this.b[sq] & PIECE_MASK;
  
    //this.runningEvalS += MATERIAL[piece];
    //this.runningEvalS += WS_PST[piece][sq];
    //this.runningEvalE += MATERIAL[piece];
    //this.runningEvalE += WE_PST[piece][sq];
  
    count++;
    next++
  }
  
  var next  = 0;
  var count = 0;
  
  while (count < this.bCount) {
  
    sq = this.bList[next];
  
    if (!sq) {
      next++;
      continue;
    }
  
    var piece = this.b[sq] & PIECE_MASK;
  
    //this.runningEvalS -= MATERIAL[piece];
    //this.runningEvalS -= BS_PST[piece][sq];
    //this.runningEvalE -= MATERIAL[piece];
    //this.runningEvalE -= BE_PST[piece][sq];
  
    count++;
    next++
  }
  
  
  //}}}
*/
  this.compact();

  for (var i=0; i < spec.moves.length; i++) {
    if (!this.playMove(spec.moves[i]))
      return 0;
  }

  this.compact();

  for (var i=0; i < 7; i++) {
    for (var j=0; j < 144; j++)
      this.wHistory[i][j] = 0;
  }

  for (var i=0; i < 7; i++) {
    for (var j=0; j < 144; j++)
      this.bHistory[i][j] = 0;
  }

  return 1;
}

//}}}
//{{{  .dataGen

lozBoard.prototype.dataGen = function (file, games, softNodes, hardNodes, random, first) {

  const fs = require('fs');

  //{{{  check args
  
  try {
    fs.accessSync(file, fs.constants.F_OK);
    console.log('file exists!',file);
    process.exit();
  } catch (err) {
    ;
  }
  
  console.log('file',file,'games',games,'softnodes',softNodes,'hardnodes',hardNodes,'randomply',random,'firstply',first);
  
  //}}}
  //{{{  randomise
  
  let now = new Date();
  let midnight = new Date(now);
  midnight.setHours(0, 0, 0, 0);
  let n = Math.floor((now - midnight) / 1000);
  for (let i=0; i < n; i++)
    Math.random();
  
  //}}}

  fs.writeFileSync(file,'');

  SILENT = 1;
  DATAGEN = 1;

  const node = lozza.rootNode;

  var move = 0;
  var givesCheck = '';
  var inCheck = '';
  var noisy = '';
  var ply = 0;
  var fen = '';
  var fens = [];
  var result = '';
  var o = '';

  for (var i=0; i < games; i++) {
    //{{{  play game
    
    ply = 0;
    fens = [];
    
    docmd('u');
    docmd('p s');
    
    if (Math.random() > 0.5)
      this.turn = colourToggle(this.turn);
    
    while (true) {
       ply++;
       fen = this.fen(this.turn);
       //{{{  get move
       
       if (ply <= random) {
         move = this.randomMove();
         if (!move) {
           result = 'x';  // ignore this game
           break;
         }
       }
       else {
         var nodes = softNodes;
         if (ply < first)
           nodes = nodes * (first - ply);
         //console.log(nodes);
         docmd('go nodes ' + hardNodes + ' softnodes ' + nodes);
         move = lozza.stats.bestMove;
         if (!move) {
           if (this.turn == WHITE)
             result = '0.0';  // sic
           else
             result = '1.0';
           break;
         }
       }
       
       //}}}
       //{{{  in check?
       
       if (this.isKingAttacked(colourToggle(this.turn)))
         inCheck = 'c';
       else
         inCheck = '-';
       
       //}}}
       this.makeMove(node,move);
       //{{{  well ahead?
       
       //if (Math.abs(lozza.stats.bestScore > 2000)) {
         //console.log('ahead');
         //break;
       //}
       
       //}}}
       //{{{  draw?
       
       if (this.repHi - this.repLo > 40) {
         if (lozza.stats.bestScore > 400)
           result = '1.0';
         else if (lozza.stats.bestScore < -400)
           result = '0.0';
         else
           result = '0.5';
         break;
       }
       
       if (this.isDraw()) {
         result = '0.5';
         break;
       }
       
       //}}}
       //{{{  gives check?
       
       if (this.isKingAttacked(this.turn))
         givesCheck = 'g';
       else
         givesCheck = '-';
       
       //}}}
       //{{{  sort out score
       
       if (this.turn == BLACK)
         lozza.stats.bestScore = -lozza.stats.bestScore;
       
       //}}}
       //{{{  noisy?
       
       if (moveIsNoisy(move))
         noisy = 'n';
       else
         noisy = '-';
       
       //}}}
       if (ply > first)
         fens.push(fen + ' ' + lozza.stats.bestScore + ' ' + this.formatMove(move,UCI_FMT) + ' ' + noisy + ' ' + inCheck + ' ' + givesCheck);
       this.turn = colourToggle(this.turn);
    }
    
    if (result != 'x') {
      for (var j=0; j < fens.length; j++) {
        //console.log(fens[j],result);
        o += fens[j] + ' ' + result + '\r\n';
        if (o.length > 100000) {
          fs.writeFileSync(file,o);
          o = '';
        }
      }
    }
    
    //}}}
  }

  if (o.length) {
    fs.writeFileSync(file,o);
  }

  DATAGEN = 0;
  SILENT = 0;
}

//}}}
//{{{  .compact

lozBoard.prototype.compact = function () {

  //{{{  compact white list
  
  var v = [];
  
  for (var i=0; i<16; i++) {
    if (this.wList[i])
      v.push(this.wList[i]);
  }
  
  v.sort(function(a,b) {
    return lozza.board.b[b] - lozza.board.b[a];
  });
  
  for (var i=0; i<16; i++) {
    if (i < v.length) {
      this.wList[i] = v[i];
      this.z[v[i]]  = i;
    }
    else
      this.wList[i] = EMPTY;
  }
  
  this.firstWP = 0;
  for (var i=0; i<16; i++) {
    if (this.b[this.wList[i]] == W_PAWN) {
      this.firstWP = i;
      break;
    }
  }
  
  
  //}}}
  //{{{  compact black list
  
  var v = [];
  
  for (var i=0; i<16; i++) {
    if (this.bList[i])
      v.push(this.bList[i]);
  }
  
  v.sort(function(a,b) {
    return lozza.board.b[b] - lozza.board.b[a];
  });
  
  for (var i=0; i<16; i++) {
    if (i < v.length) {
      this.bList[i] = v[i];
      this.z[v[i]]  = i;
    }
    else
      this.bList[i] = EMPTY;
  }
  
  this.firstBP = 0;
  for (var i=0; i<16; i++) {
    if (this.b[this.bList[i]] == B_PAWN) {
      this.firstBP = i;
      break;
    }
  }
  
  
  //}}}
}

